import React from 'react';
import { Route, Switch, useRouteMatch } from 'react-router-dom';

import MainUser from './MainUser';
import FormUser from './FormUser';
import MenuUser from './MenuUser';
import AtentionUser from './AtentionUser';
import AboutUser from './AboutUser';
import ConfirmUser from './ConfirmUser';

const RoutesApp = () => (
  <Switch>
    <Route path='/app' component={MainUser}/>
    <Route path='/app/opiniao' component={FormUser}/>
    <Route path='app/opiniao/sucesso' component={ConfirmUser}/>
    <Route path='app/atencao' component={AtentionUser}/>
    <Route path='app/sobrenos' component={AboutUser}/>
    <Route poth='app/cardapio' component={MenuUser}/>
  </Switch>
)

export default RoutesApp;
